const now = Date.now();
const oneMinute = 60000;

// Configuration
const maxMessagesPerMinute = 30;  // Change this value to configure the number of messages allowed in 60 seconds
const gapBetweenForwards = oneMinute / maxMessagesPerMinute;  // Calculate the delay required between messages

// Initialize output flag
let output = false;

// Check if payload has changed
if (currentPayload !== previousPayload) {
    output = true;
    context.set('previousPayload', currentPayload);
    context.set('lastForwardTime', now);
    context.set('forwardCount', 1);  // Reset count since this is a new payload
} else {
    // Check if it's time to forward the message again
    if (now - lastForwardTime >= gapBetweenForwards) {
        if (forwardCount < maxMessagesPerMinute) {
            output = true;
            context.set('forwardCount', forwardCount + 1);
            context.set('lastForwardTime', now);
        }
    }
}

