            { payload: inactiveColor, topic: 'level2@cx_color' },
            { payload: inactiveColor, topic: 'level3@cx_color' }
        ];
    } else if (level === 1) {
        payloads = [
            { payload: activeColor, topic: 'level1@cx_color' },
            { payload: '1', topic: 'level@cx_status' },
            { payload: inactiveColor, topic: 'level2@cx_color' },
            { payload: inactiveColor, topic: 'level3@cx_color' }
        ];
    } else if (level === 2) {
        payloads = [
            { payload: inactiveColor, topic: 'level1@cx_color' },
            { payload: activeColor, topic: 'level2@cx_color' },
            { payload: '2', topic: 'level@cx_status' },
            { payload: inactiveColor, topic: 'level3@cx_color' }
        ];
    } else if (level === 3) {
        payloads = [
            { payload: inactiveColor, topic: 'level1@cx_color' },
            { payload: inactiveColor, topic: 'level2@cx_color' },
            { payload: activeColor, topic: 'level3@cx_color' },
            { payload: '3', topic: 'level@cx_status' }
        ];
    }

    return payloads;
}

